A compulsive young surfer is having a rough time keeping his relationship going with his less adventurous girlfriend. But when he meets her mother, and discovers that the older woman has much more zest for adventure and sexual indulgence, he quickly becomes intrigued with her. When he catches his girlfriend making out with her mother's ex-boyfriend, their relationship comes to an abrupt end, leaving the door open for him to finally pursue his girlfriend's mother! Directed by James Avalon. 

